m_source=openai"},{"type":"url_citation","end_index":3792,"start_index":3598,"title":"School Assembly News Headlines, 9 July 2025: National, International, Business and Sports Updates","url":"https://www.moneycontrol.com/education/school-assembly-news-headlines-9-july-2025-national-international-business-and-sports-updates-article-13244167.html?utm_source=openai"},{"type":"url_citation","end_index":4172,"start_index":3974,"title":"School Assembly news headlines for today July 9, 2025: From sports to education, check 20+ national & international news","url":"https://www.indiatimes.com/events/school-assembly-news-headlines-for-today-july-9-2025-from-sports-to-education-check-20-national-international-news-663284.html?utm_source=openai"},{"type":"url_citation","end_index":4634,"start_index":4440,"title":"School Assembly News Headlines, 9 July 2025: National, International, Business and Sports Updates","url":"https://www.moneycontrol.com/education/school-assembly-news-headlines-9-july-2025-national-international-business-and-sports-updates-article-13244167.html?utm_source=openai"},{"type":"url_citation","end_index":5021,"start_index":4827,"title":"School Assembly News Headlines, 9 July 2025: National, International, Business and Sports Updates","url":"https://www.moneycontrol.com/education/school-assembly-news-headlines-9-july-2025-national-international-business-and-sports-updates-article-13244167.html?utm_source=openai"}],"logprobs":[],"text":"Here are the top news stories for Wednesday, July 9, 2025:\n\n**U.S. Politics and Trade**\n\n- **President Trump Announces New Tariffs**: President Donald Trump has imposed steep tariffs on 14 countries, including Japan, South Korea, and Malaysia, with rates up to 25%, effective August 1. This move has intensified global trade tensions and raised concerns about potential economic repercussions. ([cnbc.com](https://www.cnbc.com/2025/07/07/stock-market-today-live-updates.html?utm_source=openai))\n\n- **Upcoming African Leaders Summit**: President Trump is set to host his first African leaders' summit of his second term from July 9-11 in Washington, D.C., with leaders from Gabon, Guinea-Bissau, Liberia, Mauritania, and Senegal. The summit aims to shift U.S.-Africa relations towards trade and investment, moving away from traditional aid models. ([reuters.com](https://www.reuters.com/world/africa/first-trump-africa-summit-be-held-next-week-semafor-reports-2025-07-02/?utm_source=openai))\n\n**International News**\n\n- **Kenya Protests Turn Deadly**: At least 31 people have been killed during anti-government protests in Kenya, marking the anniversary of the 1990 Saba Saba Day pro-democracy demonstrations. The protests have led to significant unrest and raised concerns about political stability in the region. ([en.wikipedia.org](https://en.wikipedia.org/wiki/2025_in_Kenya?utm_source=openai))\n\n- **Flooding in Nepal**: The Friendship Bridge connecting Nepal's Rasuwa District with China was swept away due to flooding along the Bhotekoshi River, resulting in nine deaths and 19 people missing. Rescue operations are ongoing as authorities assess the damage. ([en.wikipedia.org](https://en.wikipedia.org/wiki/2025_in_Nepal?utm_source=openai))\n\n**Technology**\n\n- **Samsung's Galaxy Unpacked Event**: Samsung is hosting its Galaxy Unpacked event today in New York City, where it is expected to unveil the Galaxy Z Fold 7, Z Flip 7, and Galaxy Watch 8. The event will showcase the latest advancements in foldable smartphone technology and wearable devices. ([tomsguide.com](https://www.tomsguide.com/phones/samsung-phones/samsung-unpacked-july-2025-galaxy-z-fold-7-z-flip-7-galaxy-watch-8-and-everything-to-expect?utm_source=openai))\n\n- **Amazon Prime Day 2025**: Amazon's annual Prime Day event is underway, offering record-breaking tech deals and discounts on products from Apple, Samsung, Google, and more. U.S. online sales are projected to reach $23.8 billion, a 28.4% increase from last year. ([ts2.tech](https://ts2.tech/en/tech-news-today-the-biggest-stories-in-technology-science-and-innovation-july-9-2025-updated-2025-july-9th-0000-cet/?utm_source=openai))\n\n**Science**\n\n- **ESA's Solar Orbiter Captures Sun's South Pole**: The European Space Agency's Solar Orbiter has provided the first-ever images of the Sun's south pole, offering new insights into solar physics and the Sun's magnetic field. ([en.wikipedia.org](https://en.wikipedia.org/wiki/2025_in_science?utm_source=openai))\n\n- **Discovery of New Organelle in Human Cells**: Scientists have identified a previously unknown organelle, termed the hemifusome, within human cells. This discovery could have significant implications for understanding cellular processes and disease mechanisms. ([en.wikipedia.org](https://en.wikipedia.org/wiki/2025_in_science?utm_source=openai))\n\n**Business**\n\n- **Adani Power's Expansion**: Adani Power has acquired Vidarbha Industries Power Ltd, aiming to expand its capacity to 30,670 MW by 2030. This acquisition is part of the company's strategy to strengthen its position in the energy sector. ([moneycontrol.com](https://www.moneycontrol.com/education/school-assembly-news-headlines-9-july-2025-national-international-business-and-sports-updates-article-13244167.html?utm_source=openai))\n\n- **Capgemini Acquires WNS**: Capgemini has acquired Indian outsourcing firm WNS for $3.3 billion, enhancing its presence in the Indian market and expanding its service offerings. ([indiatimes.com](https://www.indiatimes.com/events/school-assembly-news-headlines-for-today-july-9-2025-from-sports-to-education-check-20-national-international-news-663284.html?utm_source=openai))\n\n**Sports**\n\n- **Wimbledon 2025 Quarterfinals**: Tennis players Novak Djokovic, Iga Swiatek, Ben Shelton, Jannik Sinner, and 18-year-old Mirra Andreeva have advanced to the quarterfinals of Wimbledon 2025, showcasing a mix of seasoned champions and emerging talents. ([moneycontrol.com](https://www.moneycontrol.com/education/school-assembly-news-headlines-9-july-2025-national-international-business-and-sports-updates-article-13244167.html?utm_source=openai))\n\n- **Angel Di Maria Returns to Rosario Central**: Football star Angel Di Maria has officially joined Rosario Central, his hometown club in Argentina, marking a significant move in his career. ([moneycontrol.com](https://www.moneycontrol.com/education/school-assembly-news-headlines-9-july-2025-national-international-business-and-sports-updates-article-13244167.html?utm_source=openai))\n\nPlease note that news developments are ongoing, and it's advisable to consult multiple sources for the most current information. "}],"role":"assistant"}}

